// Home page component
import React, { useState } from 'react';
import UploadImage from '../components/UploadImage';
import ChatBot from '../components/ChatBot';
import Dashboard from '../components/Dashboard';

const Home = () => {
  const [activeTab, setActiveTab] = useState('triage');
  const [analysisResults, setAnalysisResults] = useState(null);
  const [triageResults, setTriageResults] = useState(null);
  const [analysisType, setAnalysisType] = useState('skin');

  const handleImageAnalysis = (results, imageData) => {
    setAnalysisResults(results);
    setActiveTab('results');
  };

  const handleTriageComplete = (results) => {
    setTriageResults(results);
    setActiveTab('results');
  };

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  const handleAnalysisTypeChange = (type) => {
    setAnalysisType(type);
    setAnalysisResults(null); // Clear previous results
  };

  return (
    <div className="home-container">
      <div className="hero-section">
        <div className="hero-content">
          <h1>🏥 MediScan-AI</h1>
          <p className="hero-subtitle">
            AI-Powered Medical Diagnosis Assistant
          </p>
          <p className="hero-description">
            Get instant analysis of skin lesions, X-rays, and virtual triage assessment 
            using advanced artificial intelligence technology.
          </p>
        </div>
      </div>

      <div className="main-content">
        <div className="tab-navigation">
          <button
            className={`tab-btn ${activeTab === 'triage' ? 'active' : ''}`}
            onClick={() => handleTabChange('triage')}
          >
            <span className="tab-icon">🩺</span>
            Virtual Triage
          </button>
          <button
            className={`tab-btn ${activeTab === 'skin' ? 'active' : ''}`}
            onClick={() => handleTabChange('skin')}
          >
            <span className="tab-icon">🔬</span>
            Skin Analysis
          </button>
          <button
            className={`tab-btn ${activeTab === 'radiology' ? 'active' : ''}`}
            onClick={() => handleTabChange('radiology')}
          >
            <span className="tab-icon">🩻</span>
            X-ray Analysis
          </button>
          <button
            className={`tab-btn ${activeTab === 'results' ? 'active' : ''}`}
            onClick={() => handleTabChange('results')}
          >
            <span className="tab-icon">📊</span>
            Results
          </button>
        </div>

        <div className="tab-content">
          {activeTab === 'triage' && (
            <div className="tab-panel">
              <div className="panel-header">
                <h2>🩺 Virtual Triage Assistant</h2>
                <p>
                  Describe your symptoms to get personalized guidance and 
                  recommendations for your next steps.
                </p>
              </div>
              <ChatBot onTriageComplete={handleTriageComplete} />
            </div>
          )}

          {activeTab === 'skin' && (
            <div className="tab-panel">
              <div className="panel-header">
                <h2>🔬 Skin Lesion Analysis</h2>
                <p>
                  Upload a clear image of a skin lesion for AI-powered analysis 
                  and risk assessment.
                </p>
              </div>
              <UploadImage
                onImageUpload={handleImageAnalysis}
                analysisType="skin"
              />
            </div>
          )}

          {activeTab === 'radiology' && (
            <div className="tab-panel">
              <div className="panel-header">
                <h2>🩻 X-ray Analysis</h2>
                <p>
                  Upload chest X-rays for automated pathology detection and 
                  clinical insights.
                </p>
              </div>
              <UploadImage
                onImageUpload={(results, imageData) => {
                  handleAnalysisTypeChange('radiology');
                  handleImageAnalysis(results, imageData);
                }}
                analysisType="radiology"
              />
            </div>
          )}

          {activeTab === 'results' && (
            <div className="tab-panel">
              <Dashboard
                analysisResults={analysisResults}
                triageResults={triageResults}
                analysisType={analysisType}
              />
            </div>
          )}
        </div>
      </div>

      <div className="features-section">
        <h2>🌟 Key Features</h2>
        <div className="features-grid">
          <div className="feature-card">
            <div className="feature-icon">🤖</div>
            <h3>AI-Powered Analysis</h3>
            <p>
              Advanced machine learning models trained on medical datasets 
              for accurate diagnosis assistance.
            </p>
          </div>

          <div className="feature-card">
            <div className="feature-icon">⚡</div>
            <h3>Instant Results</h3>
            <p>
              Get analysis results in seconds, not hours. Quick insights 
              for faster decision making.
            </p>
          </div>

          <div className="feature-card">
            <div className="feature-icon">🔒</div>
            <h3>Privacy First</h3>
            <p>
              Your medical data is processed securely and never stored 
              without your explicit consent.
            </p>
          </div>

          <div className="feature-card">
            <div className="feature-icon">👨‍⚕️</div>
            <h3>Clinical Grade</h3>
            <p>
              Built with medical professionals using clinically validated 
              algorithms and best practices.
            </p>
          </div>
        </div>
      </div>

      <div className="disclaimer-section">
        <div className="disclaimer-content">
          <h3>⚠️ Important Medical Disclaimer</h3>
          <p>
            MediScan-AI is designed to assist healthcare professionals and provide 
            educational information. It is not intended to replace professional 
            medical advice, diagnosis, or treatment. Always consult with a qualified 
            healthcare provider for medical concerns. In case of emergency, call 911 
            immediately.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Home;
